import React from 'react';
import { useNavigate } from 'react-router-dom';

const AdminLanding = () => {
    const navigate = useNavigate();

    return (
        <div style={{ textAlign: 'center', marginTop: '50px' }}>
            <h1>Welcome to Admin Panel</h1>
            <div style={{ marginTop: '30px' }}>
                <button
                    onClick={() => navigate('/admin/student-reports')}
                    style={{
                        padding: '15px 30px',
                        margin: '10px',
                        backgroundColor: '#007bff',
                        color: '#fff',
                        border: 'none',
                        borderRadius: '5px',
                        cursor: 'pointer',
                        fontSize: '16px',
                    }}
                >
                    Student Report
                </button>
                <button
                    onClick={() => navigate('/admin/faculty-reports')}
                    style={{
                        padding: '15px 30px',
                        margin: '10px',
                        backgroundColor: '#28a745',
                        color: '#fff',
                        border: 'none',
                        borderRadius: '5px',
                        cursor: 'pointer',
                        fontSize: '16px',
                    }}
                >
                    Faculty Report
                </button>
            </div>
        </div>
    );
};

export default AdminLanding;
